post_text:
Sullivan West Central School District – Reminder to Register!

Parents/Guardians: We are still accepting students for our Pre-Kindergarten classes.

For Pre-Kindergarten your child needs to be 4-years old by December 1, 2020

Please call Lisa Moran, Registrar, at (845) 482-4610 ext. 3006 or email moranlis@swcsd.org with the following information:

• Child’s name;
• Date of birth;
• Parent/Guardian name;
• Mailing address;
• Phone number

